import React, { useState, useEffect, useContext } from 'react';
import {
    Header, Icon, Form, Image, Message,
    Segment, Grid, Modal, Search, Button, Dimmer, Loader, Input, List, Label, Divider, Item, Dropdown, Select, Checkbox
} from 'semantic-ui-react';

import { useForm } from "react-hook-form";
import Timekeeper from 'react-timekeeper';
import { DateInput, TimeInput, DateTimeInput, DatesRangeInput } from 'semantic-ui-calendar-react';

const Registration_Fifth = ({ formData, setForm, navigation }) => {

    const {
        COUNSELLOR_TIME_ZONE_CODE,
        COUNSELLOR_AVAILABILITY_DATE,

        COUNSELLOR_AVAILABILITY_MONDAY,
        COUNSELLOR_AVAILABILITY_TIME_MONDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_MONDAY_TO,

        COUNSELLOR_AVAILABILITY_TUESDAY,
        COUNSELLOR_AVAILABILITY_TIME_TUESDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_TUESDAY_TO,

        COUNSELLOR_AVAILABILITY_WEDNESDAY,
        COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_TO,

        COUNSELLOR_AVAILABILITY_THURSDAY,
        COUNSELLOR_AVAILABILITY_TIME_THURSDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_THURSDAY_TO,

        COUNSELLOR_AVAILABILITY_FRIDAY,
        COUNSELLOR_AVAILABILITY_TIME_FRIDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_FRIDAY_TO,

        COUNSELLOR_AVAILABILITY_SATURDAY,
        COUNSELLOR_AVAILABILITY_TIME_SATURDAY_FROM,
        COUNSELLOR_AVAILABILITY_TIME_SATURDAY_TO

    } = formData;


    const [days, setDays] = useState({
        MONDAY: '',
        MONDAY_FROM: '',
        MONDAY_TO: '',

        TUESDAY: '',
        TUESDAY_FROM: '',
        TUESDAY_TO: '',

        WEDNESDAY: '',
        WEDNESDAY_FROM: '',
        WEDNESDAY_TO: '',

        THURSDAY: '',
        THURSDAY_FROM: '',
        THURSDAY_TO: '',

        FRIDAY: '',
        FRIDAY_FROM: '',
        FRIDAY_TO: '',

        SATURDAY: '',
        SATURDAY_FROM: '',
        SATURDAY_TO: ''

    });

    const friendOptions = [
        {
            key: 'Jenny Hess',
            text: 'Jenny Hess',
            value: 'Jenny Hess',
            image: { avatar: true, src: '/images/avatar/small/jenny.jpg' },
        },
        {
            key: 'Elliot Fu',
            text: 'Elliot Fu',
            value: 'Elliot Fu',
            image: { avatar: true, src: '/images/avatar/small/elliot.jpg' },
        },
    ]

    const { handleSubmit, register, errors } = useForm({

    });



    const onSubmit = (data) => {
        navigation.next()
    };

    const Counsellor_TimeZone = [
        {
            title: "Choose Institute",
            name: [
                "Adrenaline Addicts", "Culture Lovers", "Aquatic adventures", "Beach enthusiasts"
            ],
            code: [0, 1, 2, 3]
        }
    ]

    const onTimeChangeHandler = (e) => {
        setDays({ ...days, [e.target.name]: e.target.value })
    }

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_MONDAY_FROM = days.MONDAY_FROM;
        console.log("01", formData.COUNSELLOR_AVAILABILITY_TIME_MONDAY_FROM)
        console.log("02", COUNSELLOR_AVAILABILITY_TIME_MONDAY_FROM)
        console.log("03", days.MONDAY_FROM)
    }, [days.MONDAY_FROM])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_MONDAY_TO = days.MONDAY_TO;
    }, [days.MONDAY_TO])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_TUESDAY_FROM = days.TUESDAY_FROM;
    }, [days.TUESDAY_FROM])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_TUESDAY_TO = days.TUESDAY_TO;
        console.log("04", formData.COUNSELLOR_AVAILABILITY_TIME_TUESDAY_TO)
        console.log("05", COUNSELLOR_AVAILABILITY_TIME_TUESDAY_TO)
        console.log("06", days.TUESDAY_TO)
    }, [days.TUESDAY_TO])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_FROM = days.WEDNESDAY_FROM;
    }, [days.WEDNESDAY_FROM])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_TO = days.WEDNESDAY_TO;
    }, [days.WEDNESDAY_TO])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_THURSDAY_FROM = days.THURSDAY_FROM;
    }, [days.THURSDAY_FROM])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_THURSDAY_TO = days.THURSDAY_TO;
    }, [days.THURSDAY_TO])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_FRIDAY_FROM = days.FRIDAY_FROM;
    }, [days.FRIDAY_FROM])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_FRIDAY_TO = days.FRIDAY_TO;
    }, [days.FRIDAY_TO])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_SATURDAY_FROM = days.SATURDAY_FROM;
    }, [days.SATURDAY_FROM])

    useEffect(() => {
        formData.COUNSELLOR_AVAILABILITY_TIME_SATURDAY_TO = days.SATURDAY_TO;
    }, [days.SATURDAY_TO])


    useEffect(() => {

        if (COUNSELLOR_AVAILABILITY_TIME_MONDAY_FROM)
            setDays({ MONDAY_FROM: COUNSELLOR_AVAILABILITY_TIME_MONDAY_FROM })

        if (COUNSELLOR_AVAILABILITY_TIME_MONDAY_TO)
            setDays({ MONDAY_TO: COUNSELLOR_AVAILABILITY_TIME_MONDAY_TO })

        if (COUNSELLOR_AVAILABILITY_TIME_TUESDAY_FROM)
            setDays({ TUESDAY_FROM: COUNSELLOR_AVAILABILITY_TIME_TUESDAY_FROM })

        if (COUNSELLOR_AVAILABILITY_TIME_TUESDAY_TO)
            setDays({ TUESDAY_TO: COUNSELLOR_AVAILABILITY_TIME_TUESDAY_TO })

        if (COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_FROM)
            setDays({ WEDNESDAY_FROM: COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_FROM })

        if (COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_TO)
            setDays({ WEDNESDAY_TO: COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_TO })

        if (COUNSELLOR_AVAILABILITY_TIME_THURSDAY_FROM)
            setDays({ THURSDAY_FROM: COUNSELLOR_AVAILABILITY_TIME_THURSDAY_FROM })

        if (COUNSELLOR_AVAILABILITY_TIME_THURSDAY_TO)
            setDays({ THURSDAY_TO: COUNSELLOR_AVAILABILITY_TIME_THURSDAY_TO })

        if (COUNSELLOR_AVAILABILITY_TIME_FRIDAY_FROM)
            setDays({ FRIDAY_FROM: COUNSELLOR_AVAILABILITY_TIME_FRIDAY_FROM })

        if (COUNSELLOR_AVAILABILITY_TIME_FRIDAY_TO)
            setDays({ FRIDAY_TO: COUNSELLOR_AVAILABILITY_TIME_FRIDAY_TO })

        if (COUNSELLOR_AVAILABILITY_TIME_SATURDAY_FROM)
            setDays({ SATURDAY_FROM: COUNSELLOR_AVAILABILITY_TIME_SATURDAY_FROM })

        if (COUNSELLOR_AVAILABILITY_TIME_SATURDAY_TO)
            setDays({ SATURDAY_TO: COUNSELLOR_AVAILABILITY_TIME_SATURDAY_TO })
    }, [])

    console.log(formData)

    return (

        <Grid>
            <Grid.Column>
                <Form size='small' onSubmit={handleSubmit(onSubmit)}>
                    <center>

                        <h1>Availability</h1>
                        <h2>Set your time zone</h2>

                        <Item.Group>
                            <Item>
                                <Item.Content>
                                    <Form.Group>
                                        <Form.Field className="CustomForm">
                                            <label>Country of origin</label>
                                            <select name="COUNSELLOR_TIME_ZONE_CODE" value={COUNSELLOR_TIME_ZONE_CODE} onChange={setForm} placeholder="choose subject">
                                                {
                                                    Counsellor_TimeZone.map((level) => {
                                                        return (
                                                            <React.Fragment>
                                                                <option disabled selected hidden>{level.title}</option>
                                                                {
                                                                    level.name.map((name, code) => <option value={code}>{name}</option>)
                                                                }
                                                            </React.Fragment>
                                                        )

                                                    })
                                                }
                                            </select>
                                        </Form.Field>
                                    </Form.Group>
                                </Item.Content>
                            </Item>

                        </Item.Group>

                        <h4>Set your Availability</h4><br />

                        <Grid>
                            <Grid.Row>
                                <Grid.Column width={16}>
                                    <center>
                                        <Segment style={{ width: '50%', textAlign: 'center', border: '0px solid transparent' }}>


                                            <Segment.Group horizontal size="tiny" className="HeadingForAvailability">
                                                <Segment className="customSegment">
                                                    <Label color="teal" horizontal>
                                                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Days&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                                             </Label>
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <Label color="teal" horizontal>
                                                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;From&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                                             </Label>
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <Label color="teal" horizontal>
                                                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;To&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                                             </Label>
                                                </Segment>
                                            </Segment.Group>


                                            <Segment.Group horizontal size="tiny" className="HeadingForAvailability">
                                                <Segment className="customSegment">
                                                    <Label style={{ display: 'block' }}>
                                                        <Checkbox label='Monday' />
                                                    </Label>
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={COUNSELLOR_AVAILABILITY_TIME_MONDAY_FROM}
                                                        name="MONDAY_FROM"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    />
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={days.MONDAY_TO ? days.MONDAY_TO : COUNSELLOR_AVAILABILITY_TIME_MONDAY_TO}
                                                        name="MONDAY_TO"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    /></Segment>
                                            </Segment.Group>


                                            <Segment.Group horizontal size="tiny" className="HeadingForAvailability">
                                                <Segment className="customSegment">
                                                    <Label style={{ display: 'block' }}>
                                                        <Checkbox label='Tuesday' />

                                                    </Label>
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={COUNSELLOR_AVAILABILITY_TIME_TUESDAY_FROM}
                                                        name="TUESDAY_FROM"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    />
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={COUNSELLOR_AVAILABILITY_TIME_TUESDAY_TO}
                                                        name="TUESDAY_TO"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    /></Segment>
                                            </Segment.Group>


                                            <Segment.Group horizontal size="tiny" className="HeadingForAvailability">
                                                <Segment className="customSegment">
                                                    <Label style={{ display: 'block' }}>
                                                        <Checkbox label='Wednesday' />

                                                    </Label>
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={days.WEDNESDAY_FROM ? days.WEDNESDAY_FROM : formData.COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_FROM}
                                                        name="WEDNESDAY_FROM"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    />
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={days.WEDNESDAY_TO ? days.WEDNESDAY_TO : formData.COUNSELLOR_AVAILABILITY_TIME_WEDNESDAY_TO}
                                                        name="WEDNESDAY_TO"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    /></Segment>
                                            </Segment.Group>


                                            <Segment.Group horizontal size="tiny" className="HeadingForAvailability">
                                                <Segment className="customSegment">
                                                    <Label style={{ display: 'block' }}>
                                                        <Checkbox label='Thursday' />

                                                    </Label>
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={days.THURSDAY_FROM ? days.THURSDAY_FROM : formData.COUNSELLOR_AVAILABILITY_TIME_THURSDAY_FROM}
                                                        name="THURSDAY_FROM"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    />
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={days.THURSDAY_TO ? days.THURSDAY_TO : formData.COUNSELLOR_AVAILABILITY_TIME_THURSDAY_TO}
                                                        name="THURSDAY_TO"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    /></Segment>
                                            </Segment.Group>

                                            <Segment.Group horizontal size="tiny" className="HeadingForAvailability">
                                                <Segment className="customSegment">
                                                    <Label style={{ display: 'block' }}>
                                                        <Checkbox label='Friday' />

                                                    </Label>
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={days.FRIDAY_FROM ?  days.FRIDAY_FROM : formData.COUNSELLOR_AVAILABILITY_TIME_FRIDAY_FROM}
                                                        name="FRIDAY_FROM"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    />
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={days.FRIDAY_TO ?  days.FRIDAY_TO : formData.COUNSELLOR_AVAILABILITY_TIME_FRIDAY_TO}
                                                        name="FRIDAY_TO"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    /></Segment>
                                            </Segment.Group>

                                            <Segment.Group horizontal size="tiny" className="HeadingForAvailability">
                                                <Segment className="customSegment">
                                                    <Label style={{ display: 'block' }}>
                                                        <Checkbox label='Saturday' />

                                                    </Label>
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={days.SATURDAY_FROM?  days.SATURDAY_FROM : formData.COUNSELLOR_AVAILABILITY_TIME_SATURDAY_FROM}
                                                        name="SATURDAY_FROM"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    />
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={days.SATURDAY_TO ? days.SATURDAY_TO : formData.COUNSELLOR_AVAILABILITY_TIME_SATURDAY_TO}
                                                        name="SATURDAY_TO"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    /></Segment>
                                            </Segment.Group>



                                        </Segment>
                                    </center>
                                </Grid.Column>
                            </Grid.Row>
                        </Grid>
                        <br />
                        <Button
                            color='teal'
                            fluid
                            size='large'
                            onClick={() => navigation.previous()}
                        >
                            Back
                            </Button>

                        <Button
                            color='teal'
                            fluid
                            size='large'
                            type="submit"
                            onClick={() => navigation.next()}
                        >
                            Next
                    </Button>

                    </center>
                </Form>

            </Grid.Column>
        </Grid >
    )

